import React, { Fragment } from 'react';
import classes from './Input.module.css';

const Input = (props) => {
  return (
    <Fragment className={classes.input}>
      <label id={props.id}>{props.label}</label>
      <input
        id={props.id}
        type={props.type}
        value={props.value}
        onChange={props.onChange}
        onBlur={props.onBlur}
      />
    </Fragment>
  );
};

export default Input;
